from sympy import isprime, primerange, floor
def a(n):
    s=0
    for p in primerange(((n + 2)//3), n - 3):
        for q in primerange(((n - p + 1)//2), min(n - p - 2, p) + 1):
            if isprime(n - p - q): s+=1
    return s
